import React from "react";
import { Button } from "antd";
import { createGlobalStyle } from "styled-components";

const GlobalButton = createGlobalStyle`
.ant-btn-primary{
  background:red;
}
`;

const DoneFail = () => {
  return (
    <div>
      <Button type="primary">&nbsp;</Button>
    </div>
  );
};

export default DoneFail;
